import React, { Component } from "react";
import { Switch, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home";
import Login from "./Components/Login";
import Signup from './Components/Signup';
import StaffOnboarding from './Components/Onboarding/Staff_onboarding';
import StaffOnboarding2 from './Components/Onboarding/Staff_onboarding_2';
import StaffOnboarding3 from "./Components/Onboarding/Staff_onboarding_3";
import StaffOnboarding_Preview from './Components/Onboarding/Staff_onboarding_preview';
import AdminDashboard from "./Components/Dashboard/AdminDashboard/AdminDashboard";
import AdminStaffs from "./Components/Dashboard/AdminDashboard/Admin_Staffs";

class App extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Switch>
            <Route component={Login} path="/login" />
            <Route component={Signup} path="/signup" />
            <Route component={StaffOnboarding} path="/staffonboarding" />
            <Route component={StaffOnboarding2} path="/staffonboarding2" />
            <Route component={StaffOnboarding3} path="/staffonboarding3" />
            <Route component={StaffOnboarding_Preview} path="/staffonboarding_preview" />
            <Route component={AdminDashboard} path="/admindashboard" />
            <Route component={AdminStaffs} path={"/dashboard/staff"} exact={true}/>
            <Route component={AdminStaffs} path={"/dashboard/staff/:1"} exact={true}/>
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
